import React from "react";
import {Heading} from './heading.js'
import  ReactDOM  from "react-dom";
import { responsive } from "./responsive.js";
import Side_bar from "./side_bar.js";
export class Cpp_header extends React.Component{
    constructor(props){
        super(props)
        this.state={style:responsive.dsa.Main(),text:responsive.dsa.text()}
        this.resize=this.resize.bind(this);
        window.addEventListener('resize',this.resize);
    }
    resize(){
        this.setState({style:responsive.dsa.Main(),text:responsive.dsa.text()})
    }
    handleClick(){
       // let root=this.props.root;
        ReactDOM.render(<Cpp/>,document.getElementById('root'));
    }
    render(){
        return (
            <button style={this.state.style} onClick={()=>{this.handleClick()}}>
                <p>
                C++
                </p>
             <p style={this.state.text}>
                CPP is a low level programming language developed which is considered as one of the fastest compiled programing language
                take mock test on pointers,templates,OOP's and various topics on CPP
            </p>
            </button>
        )
    }
}
export class Cpp extends React.Component{
    constructor(props)
    {
        super(props)
        let arr=['Data\ntypes','Array','String','Pointers','Classes','Templates']
        this.state={topics:arr}
    }
    render(){
        return(
            <div>
            <Heading/>
            <Side_bar arr={this.state.topics}/>
            </div>
        )
    }
}
